import React from 'react';
import '../stylesheets/navbar.css';

import logo from '../images/logo_icon.gif';

function Navbar() {

  const flexBox = 'd-flex flex-row align-items-center justify-content-around container';

  return (
    <ul className={flexBox} id='nav-container'>
      <li><img style={{maxWidth:'16vw'}}src={logo}></img></li>
      <li><a href='#'>Motion Graphics</a></li>
      <li><a href='#'>Graphic Design</a></li>
    </ul>
  );
};


export default Navbar;
